      SELECT DISTINCT + 27 + + 27 - - + col0 AS col2 FROM tab0 (FORMAT parquet) WHERE NULL BETWEEN - 56 + col0 / - CAST ( NULL AS INTEGER ) AND - + col1 * ( + - 99 ) * - col0 + + col1 * col2 / col1;
  - name: tab0

outputs:
  - name: q8386.out
    data: |
